&lt;p&gt;
	Evidence of nitrogen tetroxide (NTO) and monomethylhydrazine (MMH) propellant vapor leakage across the primary and secondary shafts seals of the four OMS-E series valve ball valve pinions have been found on nearly all OMS engines processed at the NASA White Sands Test Facility since 1996. This leakage results in various forms of internal damage to series valve ball valve pinions and actuator assembly components.&amp;nbsp; Two in-flight anomalies occurred during Shuttle flight history (STS-91 OMS-E serial number [S/N] 107; and STS-101 on OMS-E S/N 111) that were direct results of propellant vapor leakage.&lt;/p&gt;
&lt;p&gt;
	Testing was performed in FY 2012 and 2013 to attempt to characterize/determine the conditions under which the vapors migrate/permeate past the redundant (primary and secondary) shafts seals on the ball valve pinions and into the actuator housings.&amp;nbsp; In FY 2012 a &amp;ldquo;simple soak&amp;rdquo; test was performed in which NTO and MMH were introduced into their respective cavities in a flight series valve and vapor break-through monitored downstream of the primary and secondary shaft seals of each of the four ball valves using vapor detection devices.&amp;nbsp; The follow-on testing performed in FY 2013 focuses on the MMH part of the series valve.&amp;nbsp; In this test, MMH is introduced into the cavity between the fuel ball valves, the cavity pressurized to 250 pounds per square inch gage (psig), and monitoring performed downstream of the primary and secondary shaft seals using vapor detection devices.&lt;/p&gt;
&lt;p&gt;
	FY 2012 soak tests resulted in evidence of NTO vapor permeation past the primary and secondary shaft seals of the oxidizer ball valves in 2.5 and 18.5 hours respectively.&amp;nbsp; While MMH vapor permeation was measured at the primary shaft seal locations of the fuel ball valves in 1.5 hours, no evidence of permeation past the secondary shaft seal was measured after 6 weeks of data logging.&amp;nbsp; This resulted in the follow-on test in FY 2013 to add pressurization of the fuel ball valve cavity to determine if this would result in MMH vapor measurements downstream of the fuel ball valve secondary shaft seal locations.&amp;nbsp; FY 2013 testing will be completed by September 2013 and results compiled in a test report.&lt;/p&gt;
